function ficha(obra, doc, y, numPages, pageHeight){
    //Hay tres tipos de fichas, la normal es como se indico en la reunion. La opcion 2 es video, solo se ubica el link
    //a youtube. Y la tercera opcion es la lista de fotos cuando es escultura. Las fotos se ubican debajo de la ficha.
    //info = JSON.parse(infoC);
    //obra = info[1].obras[1];
    lines = doc.splitTextToSize(obra.descripcion, 135);
    //La ficha no puede ser cortada ---
    console.log(y);
    lFicha = 135 + ((lines.length)*3+15); 
    if(!validar(y+lFicha, doc, numPages, pageHeight)){
        numPages+=1;
        y=40;
    }
    y+=15;
    doc.setLineWidth(5);
    doc.line(25, y, 175, y);
    c= y;
    y+=15;
    doc.setFontSize(11);
    doc.setFontType('bold');
    doc.setFont('helvetica');
    doc.text(30, y, 'Ficha Museografica.');
    doc.setFontSize(10);
    y+=10;
    b = y ;
    doc.text(35, y, 'Autor: ');
    y+=5;
    doc.text(35, y, 'Titulo: ');
    y+=5;
    doc.text(35, y, 'Asignatura: ');
    y+=5;
    doc.text(35, y, 'Ciclo: ');
    y+=5;
    doc.text(35, y, 'Tutor: ');
    y+=5;
    doc.text(35, y, 'Tcnica: ');
    y+=5;
    doc.text(35, y, 'Dimensiones: ');
    y+=5;
    doc.text(35, y, 'Fecha de produccin: ');
    
    doc.setFontType('normal');
    doc.text(48, b, obra.autor);
    b+=5;
    doc.text(48, b, obra.titulo);
    b+=5;
    doc.text(56, b, obra.asignatura);
    b+=5;
    doc.text(46, b, obra.ciclo+'');
    b+=5;
    doc.text(47, b, obra.tutor);
    b+=5;
    doc.text(51, b, obra.tecnica);
    b+=5;
    doc.text(60, b, obra.dimensiones);
    b+=5;
    doc.text(74, b, obra.fechaProduccion);
    y+=15;
    doc.setLineWidth(5);
    doc.line(25, y, 175, y);
    doc.setFontSize(11);
    y+=20;
    doc.setFontType('bold');
    doc.setFont('helvetica');
    doc.text(30, y, 'Descripcion:');
    doc.setFontSize(10);
    doc.setFontType('normal');
    y+=10;
    console.log(lines);
    doc.text(35, y, lines);
    y+=((lines.length)*3+15);
    doc.line(25, y, 175, y);
    doc.setLineWidth(0.1);
    doc.line(25.1, c, 25.1, y);
    doc.line(174.99, c, 174.99, y);
    console.log(y+15-((lines.length)*3+15));
    console.log(obra.imagenes);
    if (obra.imagenes != 'null' && obra.imagenes != ' ' && obra.imagenes != ''){
        listaIMG = obra.imagenes.split(';');
        listaIMG = listaIMG.filter(item => item !== '');
        if(listaIMG.length == 1){
            formato = img64[listaIMG[0]].split(';')[0].split('/')[1];
            doc.addImage(img64[listaIMG[0]], formato, 115, c+10, 40, 60);
           // transformImages(doc,  115, c+10, 40, 60, obra.nombreElemento);
            y+=15;
        }else{
            console.log(listaIMG);
            y+=15;
            if(!validar(y+75,doc,numPages,pageHeight)){
                y=40;
                numPages+=1;
            }
            doc.setFontType('bold');
            doc.text(35, y, 'Vistas de la obra: ');
            y+=10;
            out =listaIMG.length;
            for(var i=0;i<listaIMG.length;i++){
                maxV = out>2? 3: out;
                lEsc = 70;
                if(!validar(y+lEsc, doc, numPages, pageHeight)){
                    y=40;
                    numPages+=1;
                }
                console.log('maxV: ', maxV);
                for (var j=35;j<(50*maxV)+1;j++){
                    //transformar imagenes a base4
                    formato = img64[listaIMG[i]].split(';')[0].split('/')[1];
                    doc.addImage(img64[listaIMG[i]], formato, j, y, 40, 60);
                   // transformImages(doc,  j, y, 40, 60, listaIMG[i]);
                    j+=50;
                    i+=1;
                    out-=1;
                }
                y+=70;
                //i+=2;
                //out-=(i);
                i-=1;
                console.log('i:', i, 'out', out);
            }
            y+=10;
        }
    }else{
        y+=30;
    }
    console.log(obra.linkVideoYoutube);
    if(obra.linkVideoYoutube != "null"){
        y+=15;
        if(!validar(y+5,doc,numPages,pageHeight)){
            y=40;
            numPages+=1;
        }
        doc.setFontType('bold');
        doc.text(35, y, 'Youtube: ');
        doc.setFontType('normal');
        doc.text(51, y, obra.linkVideoYoutube);
        y+=5;
    }
    lFinal = 20;
    if(!validar(y+lFinal,doc,numPages,pageHeight)){
        y=40;
        numPages+=1;
    }
    doc.setFontType('bold');
    b = y;
    doc.text(35, y, 'Facebook: ');
    y+=5;
    doc.text(35, y, 'Instagram: ');
    y+=5;
    doc.text(35, y, 'Pgina Web: ');
    doc.setFontType('normal');
    doc.text(53, b, obra.facebook == "null" ? '' : obra.facebook );
    b+=5;
    doc.text(53, b, obra.instagram == "null" ? '' : obra.instagram);
    b+=5;
    doc.text(57, b, obra.proyectoWeb == "null" ? '' :  obra.proyectoWeb);
    y+=10;
    return [y, numPages];
}

